import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import refHome from './Home';
import scrollDown from './scrollDown';
function NavigationBar() {
  return (
    <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#ahmad-numan" style={{ fontSize: '1.5rem' }}>Ahmad Numan</Navbar.Brand>
          <div className="d-flex justify-content-end w-10">
          <Nav className="me-auto" style={{ gap: '1rem', fontSize: '1.2rem' }}>
            <Nav.Link href="#" onClick={()=>scrollDown(refHome)}>Home</Nav.Link>
            <Nav.Link href="#about">About Me</Nav.Link>
            <Nav.Link href="#contact">Contact Me</Nav.Link>
          </Nav>
          </div>
        </Container>
      </Navbar>
  );
}

export default NavigationBar;
